import React from 'react'

function Nav() {

    const navegacion = (seccion) => {
        document.getElementById(seccion).scrollIntoView({ behavior : 'smooth'});
    };

    return (
        <>
          <div className="flex justify-center items-center ">
              <button onClick={() => navegacion('Inicio')} >
                Inicio
              </button>
              <button onClick={() => navegacion('Tecnologias')} >
                Tecnologías
              </button>
              <button onClick={() => navegacion('ExperienciayFormacion')} >
                Experiencia y Formación
              </button>
              <button onClick={() => navegacion('Proyectos')}>
                Proyectos
              </button>
          </div>
        </>
      );
      
      
}

export default Nav
